CREATE TABLE `freelance_projects` (
  `project_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `author_id` bigint(20) unsigned NOT NULL,
  `title` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `description` varchar(10000) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `attachment` blob DEFAULT NULL COMMENT 'Вложение',
  `price_from` int(11) DEFAULT NULL COMMENT 'Гонорар проекта',
  PRIMARY KEY (`project_id`),
  KEY `author_id` (`author_id`),
  CONSTRAINT `freelance_projects_ibfk_1` FOREIGN KEY (`author_id`) REFERENCES `users` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
